import React from 'react';
import BlogrImg from '../Assets/blogr-mobile.png';
import DashboardImg from '../Assets/dashboard-desktop-view.png';
import DevPortImg from '../Assets/developer-portfolio.png';

const projects = [
    {
        id: 'Blogr Landing Page',
        img: BlogrImg,
        detail: '',
        link: 'https://github.com',
    },
    {
        id: 'Time Tracking Dashboard',
        img: DashboardImg,
        detail: '',
        link: 'https://github.com',
    },
    {
        id: 'Developer Portfolio',
        img: DevPortImg,
        detail: '',
        link: 'https://github.com',
    },
    ]

class Projects extends React.Component {
  constructor(props){
    super(props)
  }
  render() {
    return (
      <div className="p-5 d-flex flex-row flex-wrap" style={{color:'#EEEEEE', backgroundColor:'#222831'}}>
         <h1 className="block w-100">Projects</h1>
         <p className="block w-100" style={{color:'#00ADB5'}}>Building projects and working with people are ways of honing my skill.<br/> I learn from every project</p>
         {
             projects.map(project=> 
             <div className="d-flex flex-column mx-auto w-80 rounded-3 my-3 my-sm-5" style={{maxWidth: 300, color:'#EEEEEE'}}>
                <img src={project.img} alt="Project Images" className="rounded-3" />
                <p>{project.id}</p>
            </div>
             )
         }
      </div>
    );
  }
}

export { Projects }
